import React, { useState } from 'react'
import BOOKS from '../../data/Books';
import Seminew from './seminew';

const Semibooks = () => {

    const [book] = useState(BOOKS);


    const books = book.map((book) =>{
        return <Seminew  book={book} key={book.id} />
    })


  return (
    <div>
        {books}
    </div>
  )
}

export default Semibooks;
